    true,nt"url": null,nt"notes": "The Gainful Employment Informational Rates,
    2011 (GE2011), is a collection that is part of the Gainful Employment (GE) program;
    program data is available since 2011 at <https://studentaid.ed.gov/sa/about/data-center/school/ge/data>.
    GE2011 (https://studentaid.ed.gov/sa/about/data-center/school/ge) is a universe
    data collection regarding repayment rate and debt-to-earnings ratios, as in order
    to be eligible for Title IV student assistance programs under the Higher Education
    Act (HEA), postsecondary institutions' educational programs must be proven to lead
    to a degree or to prepare students for gainful employment in a recognized occupation.
    With very few exceptions, all educational programs offered at for-profit institutions
    must lead to gainful employment in a recognized occupation. The GE2011 rates are
    for informational purposes only and, as such, do not invoke any regulatory requirements,
    sanctions, or other adverse action. These informational rates were prepared in advance
    of the July 1, 2012 effective date of the applicable regulations for the years in
    which programs that fail the debt measures will be required to provide debt warnings
    and may lose eligibility after failing three out of four consecutive years. Key
    statistics produced from GE2011 were information on repayment rates and debt-to-earnings
    ratios.",nt"license_title": "Creative Commons CCZero",nt"extras": [{ntt"key":
